const Dates = (props) => {
  const day = props.date.getDate();
  const month = props.date.getMonth();
  const year = props.date.getFullYear();
  return (
    <div>
      <div>{day}</div>
      <div>{month + 1}</div>
      <div>{year}</div>
    </div>
  );
};
export default Dates;
